import React from 'react';
import {Icon} from 'rsuite';
import 'rsuite/dist/styles/rsuite-default.css';
export type SocialIcon2Props = {
  SocialIcon?: any[];
};
const myStyle = {
  margin: '0px 15px',
};
const SocialIcon: any[] = [
  {
    icon: 'facebook-square',
    url: 'https://www.facebook.com',
    color: ' #3B5998',
    target: '_blank',
  },
  {
    icon: 'linkedin-square',
    url: 'https://in.linkedin.com/',
    color: 'white',
    target: '_blank',
  },
  {
    icon: 'twitter-square',
    url: 'https://twitter.com/?lang=en',
    color: '#00ACEE',
    target: '_blank',
  },
  {
    icon: 'pinterest-square',
    url: 'https://in.pinterest.com/',
    color: 'red',
    target: '_blank',
  },
];
export const SocialIconV = (props: SocialIcon2Props) => {
  const output: any = [];
  const getSocialIcons = () => {
    Array.isArray(props.SocialIcon) &&
      props.SocialIcon.forEach(items => {
        output.push(
          <a
            href={items.url}
            target={items.target}
            style={{color: items.color}}
          >
            <Icon icon={items.icon} size="2x" style={myStyle} />
          </a>,
        );
      });
    return output;
  };
  const AllProps = {...props};
  return <div {...AllProps}>{getSocialIcons()}</div>;
};
export default SocialIconV;
